import React from "react";

export default class Login extends React.Component {
  render() {
    return (
      <div>
        <h1> <strong> Etapa 1 - Dados Gerais </strong> </h1>
        
        <p>1- Qual o seu nome?</p><input />
        <button onClick={this.props.logar}>Entrar </button> <br/>
        <p>1- Qual a sua idade?</p><input />
        <button onClick={this.props.logar}>Entrar </button> <br/>
        <p>1- Qual seu e-mail?</p><input />
        <button onClick={this.props.logar}>Entrar </button> <br/>
        <input />
        <button onClick={this.props.logar}>Entrar </button>
      </div>
    );
  }
}
